window.bookSummaryJSON = "<p><b>\"Marisa Calin's delivery of this audiobook is superbly executed...The enticing voice she gives Alosa will enrapture listeners and draw them deeper into the story's twists and turns.\" â€” </b><b><i>AudioFile Magazine</i></b><b><br> <br> The capable, confident, and occasionally ruthless heroine of </b><b><i>Daughter of the Pirate King</i></b><b> is back in this action-packed audiobook sequel that promises rousing high seas adventures and the perfect dash of magic.</b><br> <br> Alosa's mission is finally complete. Not only has she recovered all three pieces of the map to a legendary hidden treasure, but the pirates who originally took her captive are now prisoners on her ship. Still unfairly attractive and unexpectedly loyal, first mate Riden is a constant distraction, but now he's under her orders. And she takes great comfort in knowing that the villainous Vordan will soon be facing her father's justice. <br> <br> When Vordan exposes a secret her father has kept for years, Alosa and her crew find themselves in a deadly race with the feared Pirate King. Despite the danger, Alosa knows they will recover the treasure first . . . after all, she is the daughter of the Siren Queen. <br> <br> In <i>Daughter of the Siren Queen,</i> Tricia Levenseller brings together the perfect mix of thrilling action, tense battle scenes, and a heart-pounding romance.</p>"; 
